import "./Profile.css";

const Profile = ({name,age,country,test}) => {
  return (
    <div className="profile">
      <h3>Name:{name? name: "??"}</h3>
      <h3>Age:{age? age: "??"}</h3>
      <h3>From:{country? country: "??"}</h3>
      <h3>{test? test("name","age"): "??"}</h3>
    </div>
  );
};


export default Profile;
